import React from "react";

const Uleft = ({setCom,user}) => {
  return (
    <>
      <div className="">
        <div className="UserPic text-center">
          <img src="default.png" className="pic"></img>
        <p>{user}</p>
        </div>
        <div className="adminNav">
          <ul>
            <li onClick={()=>{setCom("dashboard")}}><i className="fa fa-key me-2" aria-hidden="true"></i>Generate Key</li>
            <li onClick={()=>{setCom("profile")}}><i className="fa fa-info me-2" aria-hidden="true"></i>Key Detail</li>
            <li onClick={()=>{setCom("api")}}><i className="fa fa-user me-2" aria-hidden="true"></i>profile</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default Uleft;
